import React, { useState } from 'react';

function RecommendedItems({ data, nutrient }) {
    const [hoveredIndex, setHoveredIndex] = useState(null);

    if (!data || data.length === 0) return null;

    const label = nutrient
        .replace(/_/g, ' ')
        .replace(/\b\w/g, (c) => c.toUpperCase());

    const unitMap = {
        caffeine: 'mg',
        vitaminA: '%',
        vitaminC: '%',
        calcium: '%',
        iron: '%',
        calories: '',
    };
    const unit = unitMap[nutrient] || 'g';

    const matching = data.filter((d) =>
        d.factor.toLowerCase().includes(nutrient.toLowerCase())
    );

    let listToShow;
    let fallback = false;
    if (matching.length > 0) {
        listToShow = matching;
    } else {
        fallback = true;
        const lowestCal = data.reduce((prev, curr) =>
            curr.calories < prev.calories ? curr : prev
        );
        listToShow = [lowestCal];
    }

    return (
        <div className="drink-info">
            <h3 style={{ marginBottom: '8px' }}>
                {fallback
                    ? `No ${label} recommendation—showing lowest‐calorie drink`
                    : `Recommended ${label} Drinks`}
            </h3>
            <ul style={{ listStyleType: 'none', padding: 0, margin: 0 }}>
                {listToShow.map((item, idx) => (
                    <li
                        key={item.name}
                        style={{
                            margin: '6px 0',
                            position: 'relative',
                            cursor: 'pointer',
                            padding: '6px 10px',
                            borderRadius: '4px',
                            background: hoveredIndex === idx ? '#f0f0f0' : 'transparent',
                            transition: 'background 0.2s ease',
                        }}
                        onMouseEnter={() => setHoveredIndex(idx)}
                        onMouseLeave={() => setHoveredIndex(null)}
                    >
            <span style={{ fontSize: '15px', fontWeight: 500 }}>
              {item.name}
            </span>

                        {hoveredIndex === idx && (
                            <div
                                style={{
                                    position: 'absolute',
                                    top: '100%',
                                    left: 0,
                                    marginTop: '4px',
                                    background: 'white',
                                    border: '1px solid #ccc',
                                    borderRadius: '6px',
                                    boxShadow: '0 2px 8px rgba(0,0,0,0.15)',
                                    zIndex: 100,
                                    padding: '12px',
                                    whiteSpace: 'nowrap',
                                    fontSize: '13px',
                                    color: '#333',
                                }}
                            >
                                <div style={{ fontWeight: '600', marginBottom: '4px' }}>
                                    {item.name}
                                </div>
                                <div>Calories: {item.calories} {unitMap.calories}</div>
                                <div>Total Fat: {item.total_fat} g</div>
                                <div>Trans Fat: {item.trans_fat} g</div>
                                <div>Saturated Fat: {item.saturated_fat} g</div>
                                <div>Sodium: {item.sodium} mg</div>
                                <div>Carbohydrates: {item.carbohydrates} g</div>
                                <div>Cholesterol: {item.cholesterol} mg</div>
                                <div>Fiber: {item.fiber} g</div>
                                <div>Sugars: {item.sugars} g</div>
                                <div>Protein: {item.protein} g</div>
                                <div>Vitamin A: {item.vitaminA} %</div>
                                <div>Vitamin C: {item.vitaminC} %</div>
                                <div>Calcium: {item.calcium} %</div>
                                <div>Iron: {item.iron} %</div>
                                <div>Caffeine: {item.caffeine} mg</div>
                                <div style={{ marginTop: '2px', color: '#00704A' }}>
                                    Factor: {item.factor}
                                </div>
                            </div>
                        )}
                    </li>
                ))}
            </ul>
        </div>
    );
}

export default RecommendedItems;
